import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Table from './App';
import './i18nextConf';
import {BrowserRouter as Router, Route, Switch, Link} from 'react-router-dom'


ReactDOM.render(
  <Router>
    <Switch>
    <Route/> <Table />
    </Switch>
    </Router>
 ,
  document.getElementById('root')
);
